
function zakazi(){
    var firstName = document.formaMasaza.firstName.value;
    var lastName = document.formaMasaza.lastName.value;
    var email = document.formaMasaza.email.value;
    var phone = document.formaMasaza.phone.value;
    var date = document.formaMasaza.date.value; 
    var date_dd = date.split('-')[2];
    var date_mm = date.split('-')[1];
    var date_yyyy = date.split('-')[0];
    var problemDesc = document.formaMasaza.problemDesc.value;

    var error = false;

    //proveriti ime-min 2 slova
    var rx = /.{2,}/;
    if(!rx.test(firstName)){
        document.getElementById("nameError").innerHTML = "<br/>Ime mora sadržati minimum 2 slova.";
        error = true;
    }else{
        document.getElementById("nameError").innerHTML = "";
    }

    //proveriti prezime-min 2 slova
    if(!rx.test(lastName)){
        document.getElementById("lastnameError").innerHTML = "<br/> Prezime mora sadržati minimum 2 slova.";
        error = true;
    }else{
        document.getElementById("lastnameError").innerHTML = "";
    }

    //proveriti mejl - format ___@___.__
    var mailRegExp = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
    if(!mailRegExp.test(email)){
        document.getElementById("emailError").innerHTML = "<br/> E-mail nije u odgovarajućem formatu.";
        error = true;
    }else{
        document.getElementById("emailError").innerHTML = "";
    }

    //proveri telefon
    var mobileRegExp = /^(\d{10}|\d{3}-\d{3}-\d{4}|\(\d{3}\)\d{3}-\d{4})$/;
    if(!mobileRegExp.test(phone)){
        document.getElementById("phoneError").innerHTML = "<br/> Broj telefona nije u odgovarajucem formatu.";
        error = true;
    }else{
        document.getElementById("phoneError").innerHTML = "";
    }

    //proveriti datum, min danasnji
    var todaysDate = new Date(); 
    var dd = String(todaysDate.getDate()).padStart(2, '0');
    var mm = String(todaysDate.getMonth() + 1).padStart(2, '0'); //January is 0!
    var yyyy = todaysDate.getFullYear();
    if(date == ""){
        document.getElementById("dateError").innerHTML = "<br/> Niste odabrali datum.";
        error = true;
    }else if(date_yyyy < yyyy){
        document.getElementById("dateError").innerHTML = "<br/> Datum ne može da bude u prošlosti.";
        error = true;
    }else if((date_mm < mm) && (date_yyyy == yyyy)){
        document.getElementById("dateError").innerHTML = "<br/> Datum ne može da bude u prošlosti.";
        error = true;
    }else if((date_yyyy == yyyy) && (date_mm == mm) && (date_dd < dd)){
        document.getElementById("dateError").innerHTML = "<br/> Datum ne može da bude u prošlosti.";
        error = true;
    }else{
        document.getElementById("dateError").innerHTML = "";
    }
    

    //proveriti problem-da nije prazno
    if(problemDesc==""){
        document.getElementById("problemDescError").innerHTML = "<br/> Polje ne može biti prazno.";
        error = true;
    }else{
        document.getElementById("problemDescError").innerHTML = "";
    }

    //zapamti formu
    if(error){
        return;
    }else{
        Swal.queue([{
            icon: 'success',
            title: 'Vidimo se! :)',
            text: 'Uspešno ste rezervisali masažu. Da li želite da preuzmete zahtev u PDF formatu?',
            confirmButtonColor: 'green',
            confirmButtonText: 'Da, preuzmi PDF',
            showLoaderOnConfirm: true,
            preConfirm: () => {
                kreirajPDF();
                Swal.insertQueueStep({
                    icon: 'success',
                    title: 'Uspešno ste preuzeli formu.'
                })
            },

            showCancelButton: true,
            cancelButtonColor: 'red',
            cancelButtonText: "Ne",
            
        }])
    }
        
}

function kreirajPDF(){
    var doc = new jsPDF();
    var firstName = document.formaMasaza.firstName.value;
    var lastName = document.formaMasaza.lastName.value;
    var email = document.formaMasaza.email.value;
    var phone = document.formaMasaza.phone.value;
    var date = document.formaMasaza.date.value; 
    var date_dd = date.split('-')[2];
    var date_mm = date.split('-')[1];
    var date_yyyy = date.split('-')[0];
    var problemDesc = document.formaMasaza.problemDesc.value;

    var imgData = "data:image/jpeg;base64,";
    var text =
      "Ime i prezime: " +
      firstName + " " + lastName +
      "\n\nE-mail: " +
      email +
      "\n\nBroj telefona: " +
      phone +
      "\n\nDatum termina: " +
      date_dd + "/" + date_mm + "/" + date_yyyy +
      "\n\nOpis problema: " +
      problemDesc;
    
    doc.addImage(imgData, 'JPEG',0,0,210,297);
    doc.text(10,80,text);
    doc.save("Inferno_gym_masaza.pdf");
}